public class InnerVirtualGatewayVirtualGatewaySpecFactory(Action<Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewaySpec> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewaySpec>
{

    internal InnerVirtualGatewayVirtualGatewayLoggingFactory LoggingFactory { get; set; }

    internal InnerVirtualGatewayVirtualGatewayBackendDefaultsFactory BackendDefaultsFactory { get; set; }

    protected override Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewaySpec Create()
    {
        var virtualGatewaySpecResult = CreateVirtualGatewaySpec();
        factoryAction?.Invoke(virtualGatewaySpecResult);

        return virtualGatewaySpecResult;
    }

    private Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewaySpec CreateVirtualGatewaySpec()
    {
        var virtualGatewaySpecResult = new Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewaySpec();

        return virtualGatewaySpecResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.VirtualGatewayTypes.VirtualGatewaySpec result)
    {
        base.CreateChildren(result);

        result.Logging ??= LoggingFactory?.Build();
        result.BackendDefaults ??= BackendDefaultsFactory?.Build();
    }

} // End Of Class

